// File contracts/HWTToken.sol

pragma solidity 0.8.7;



contract HWTToken is ERC20, Ownable {
  using SafeMath for uint256;

  // The time interval from each 'mint' to the 'HWT mining pool' is not less than 365 days
  uint256 public constant MINT_INTERVAL = 365 days;

  // All of the minted 'HWT' will be moved to the mainPool.
  address public mainPool;

  uint256 public constant MAX_MINT_TIMES = 5;
  uint256 public lastMintTime;
  uint256[MAX_MINT_TIMES] public maxMintAmounts;
  uint256 public mintTimes = 0;

  constructor() ERC20("HonorWorld Token", "HWT") { 
    uint256 decimal = 10 ** uint256(decimals());
    /**
    * There will distribute 400,000,000 HWT in year 1
    *                       225,000,000 HWT in year 2
    *                       175,000,000 HWT in year 3
    *                       125,000,000 HWT in year 4
    *                       75,000,000  HWT in year 5
    */
    maxMintAmounts[0] = 400000000 * decimal;
    maxMintAmounts[1] = 225000000 * decimal;
    maxMintAmounts[2] = 175000000 * decimal;
    maxMintAmounts[3] = 125000000 * decimal;
    maxMintAmounts[4] = 75000000 * decimal;
  }

  function getNextMintTime() public view returns(uint256) {
      return lastMintTime + MINT_INTERVAL;
  }

  /** 
  * Set the target mining pool contract for minting
  */
  function setMainPool(address _pool) external onlyOwner {
      require(_pool != address(0), "HWTToken: cannot be the zero address");
      mainPool = _pool;
  }

  /**
    * Mint HWT to the main pool every year
    */
  function mint(address _to) external {
    require(msg.sender == mainPool, "HWTToken: invalid minter");
    require(mintTimes < MAX_MINT_TIMES, "HWTToken: all minted");
    if (lastMintTime > 0) {
      require(getNextMintTime() < block.timestamp, "HWTToken: minting not allowed yet");
    }

    uint256 mintAmount = maxMintAmounts[mintTimes];
    _mint(_to, mintAmount);
    mintTimes += 1;
    lastMintTime = block.timestamp;
  }

  function burn(uint256 _amount) external {
    _burn(msg.sender, _amount);
  }

  function burnFrom(address _from, uint256 _amount) external {
    require(_from != address(0), "HWTToken: burn from zero");

    _approve(_from, msg.sender, allowance(_from, msg.sender).sub(_amount));
    _burn(_from, _amount);
